import Layout from "./UIComponents/Layout";
import Registro3 from "./componentes/zonaCliente/registroComponente/Registro3";
import Login from "./componentes/zonaCliente/loginComponente/Login";
import Tienda from "./componentes/zonaTienda/tiendaComponente/Tienda";
import { Route, Routes, BrowserRouter, createBrowserRouter } from "react-router-dom";

function App() {
  const router= createBrowserRouter(
    <BrowserRouter>
      <Routes>
        <Route path="/" element={Layout}>
          <Route index element={Tienda} />
        </Route>
        <Route path="/registro" element={Registro3} />
        <Route path="/login" element={Login} />
      </Routes>
    </BrowserRouter>
  );
  return (
    <BrowserRouter>

        <Routes>
          <Route exact path="/" element={Layout}>
            <Route index element={Tienda} />
          </Route>
          <Route path="/registro" element={Registro3} />
          <Route path="/login" element={Login} />
        </Routes>

    </BrowserRouter>
  );
}

export default App;
